// src/pages/Home.js
import React from 'react';
import { useAuth } from '../component/auth'; // useAuth 훅 불러오기

const Home = () => {
  // useAuth 훅에서 token을 가져옵니다.
  const { token, logout } = useAuth();

  // token이 없으면 로그인 페이지로 이동하거나 다른 처리를 할 수 있습니다.
  if (!token) {
    return <p>로그인 해주세요.</p>;
  }

  return (
    <div>
      <h1>홈페이지</h1>
      <p>로그인 성공! Token: {token}</p>
      <button onClick={logout}>로그아웃</button>
    </div>
  );
};

export default Home;
